import React, { Component } from 'react';

class items extends Component {

    render() {

        return(
            <div className="container">
            <h1>Shop</h1>
            <table>
                <thead>
                    <tr>
                    <th>User name</th>
                    <th>Email</th>
                    <th>IP address</th>
                    </tr>
                </thead>
            </table>
            </div>
        );



    }


}

export default items;
